// Navbar.js
import React from 'react';
import styles from './Navbar.module.css';

function Navbar() {
  return (
    <div className="navbar">
      <div className="logo">Logo</div>
      <div className="sections">
        <ul>
          <li>Inicio</li>
          <li>Sobre mí</li>
          <li>Habilidades</li>
          <li>Proyectos</li>
          <li>Contacto</li>
        </ul>
      </div>
      <div className="options">
        <div className="dark-mode">Modo oscuro / claro</div>
        <div className="language">Español / Inglés</div>
      </div>
    </div>
  );
}

export default Navbar;
